import React, { Component } from 'react';

class Form extends Component {
    constructor(){
        super();
        this.state = {
            estadoFavorito: ""
        }
        this.handleChange = this.handleChange.bind(this);
    }
    handleChange(e){
        this.setState({
            estadoFavorito: e.target.value
        })
    }
    render() {
        return (
            <div>
                <h1>Estado e React</h1>
                
            </div>
        );
    }
}

export default Form;
